import React from 'react';
import { useSelector } from 'react-redux';
import Main from './main';
import LoginForm from '../components/loginForm';

const Index = () => {
  const { email } = useSelector((state) => state.user);

  return (
    <>
      {email == null
        ? (
          <div style={{ backgroundColor: '#272727', height: '800px', margin: '40%' }}>
            <img src="https://user-images.githubusercontent.com/39295881/86248913-7f8de080-bbe9-11ea-801a-73f4f426ed0d.png" alt="img" style={{ width: '500px' }} />
            <LoginForm />
          </div>
        )
        : <Main />}
    </>
  );
};

export default Index;
